import React from 'react';
import { Formik, Form, FormikHelpers } from "formik"
import FormField from '../components/Form/FromField'
import { Box, Button } from '@material-ui/core'
import { login } from '../modules/auth/authOperations'
import { connect } from 'react-redux'


type AddBankFormType = {
    handleSubmit: (values: any, actions: FormikHelpers<any>) => any
    setIsAddBank: (isOk: boolean) => void
}

const Login: React.FC<AddBankFormType> = () => {
    return (
        <Box display="flex" justifyContent="center" alignItems="center" height="100vh">
            <Box>
                <Formik
                    initialValues={{
                        catagorie: "",
                        amount: null
                    }}
                    onSubmit={(values, actions) => {
                        alert(JSON.stringify(values, null, 2));

                    }}
                >   
                    {(props) => (
                    <Form>
                        <Box>
                            <FormField
                                {...props}
                                name="amount"
                                placeholder="spent amount"
                                label="amount"
                            />
                        </Box>
                        <Box>
                            <FormField
                                {...props}
                                name="catagorie"
                                placeholder="catagorie"
                                label="catagorie"
                            />
                        </Box>
                        <Button type="submit">
                              Create entitie
                        </Button>    
                    </Form>
                    )}
                </Formik>
            </Box>
        </Box>
    );
};
const MapDispatchToProps = {
    login
}

export default connect (MapDispatchToProps)(Login);
